import collections
def findAnagrams(s,p):
    res = []
    p_counts = collections.Counter(p)
    s_counts = collections.Counter(s[0:len(p)])
    for i in range(0, len(s) - len(p) + 1):
        if i > 0:
            pre, tail = s[i - 1], s[i + len(p) - 1]
            s_counts[pre] -= 1
            s_counts[tail] += 1
            if s_counts[pre] <= 0:
                s_counts.pop(pre)
        if s_counts == p_counts:
            res.append(i)
    return res


